import './Faq.css';


const Faq = () => {
  const toggleButtons = document.querySelectorAll('.text-blue-500');

        toggleButtons.forEach((button) => {
            button.addEventListener('click', () => {
                const answer = button.parentElement.nextElementSibling;
                answer.classList.toggle('hidden');
            });
        });

  return (
    <>
    <div class="max-w-lg mx-auto">
        <h1 class="text-2xl font-semibold text-center mb-6">Frequently Asked Questions</h1>

        <div class="space-y-4">
            <div class="bg-white shadow-md rounded p-4">
                <div class="flex items-center justify-between">
                    <h2 class="text-lg font-semibold">Question 1: What is Tailwind CSS?</h2>
                    <button class="text-blue-500">Toggle</button>
                </div>
                <p class="mt-2 hidden">Tailwind CSS is a utility-first CSS framework for building modern web applications. It allows you to create custom designs quickly by applying pre-defined classes to your HTML elements.</p>
            </div>

            <div class="bg-white shadow-md rounded p-4">
                <div class="flex items-center justify-between">
                    <h2 class="text-lg font-semibold">Question 2: How do I install Tailwind CSS?</h2>
                    <button class="text-blue-500">Toggle</button>
                </div>
                <p class="mt-2 hidden">You can install Tailwind CSS using npm or yarn. First, install it as a dependency in your project. Then, create a configuration file and start using the classes in your HTML.</p>
            </div>

            <div class="bg-white shadow-md rounded p-4">
                <div class="flex items-center justify-between">
                    <h2 class="text-lg font-semibold">Question 3: Is Tailwind CSS free to use?</h2>
                    <button class="text-blue-500">Toggle</button>
                </div>
                <p class="mt-2 hidden">Yes, Tailwind CSS is open-source and free to use. You can use it in both personal and commercial projects without any licensing fees.</p>
            </div>

            <div class="bg-white shadow-md rounded p-4">
                <div class="flex items-center justify-between">
                    <h2 class="text-lg font-semibold">Question 4: Can I customize Tailwind CSS styles?</h2>
                    <button class="text-blue-500">Toggle</button>
                </div>
                <p class="mt-2 hidden">Yes, you can customize Tailwind CSS by editing the configuration file to define your own utility classes, colors, and more. Tailwind is highly configurable.</p>
            </div>

            <div class="bg-white shadow-md rounded p-4">
                <div class="flex items-center justify-between">
                    <h2 class="text-lg font-semibold">Question 5: How do I contribute to Tailwind CSS?</h2>
                    <button class="text-blue-500">Toggle</button>
                </div>
                <p class="mt-2 hidden">You can contribute to Tailwind CSS on GitHub. The project is open-source, and you can submit issues, pull requests, or documentation improvements.</p>
            </div>
        </div>
    </div>


    </>
  );
};

export default Faq;
